import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import {Table, Layout} from "antd";

const {Header, Content, Footer} = Layout;

import React, { useState } from 'react';
import {
  Form,
  Input,
  Button,
  Radio,
  Select,
  Cascader,
  DatePicker,
  InputNumber,
  TreeSelect
} from 'antd';

const chiTietDH = () => {
  const [componentSize, setComponentSize] = useState('default');

  const onFormLayoutChange = ({ size }) => {
    setComponentSize(size);
  };

  return (
    <>
      <Form
        labelCol={{
          span: 4,
        }}
        wrapperCol={{
          span: 14,
        }}
        layout="horizontal"
        initialValues={{
          size: componentSize,
        }}
        onValuesChange={onFormLayoutChange}
        size={componentSize}
      >
        <Form.Item label="Mã hóa đơn">
          <Input disabled/>
        </Form.Item>
        <Form.Item label="Ngày lập hóa đơn">
        <Input disabled/>
        </Form.Item>
        <Form.Item label="Tổng tiền">
        <Input disabled/>
        </Form.Item>
      </Form>

      <Form
        labelCol={{
          span: 4,
        }}
        wrapperCol={{
          span: 14,
        }}
        layout="horizontal"
        initialValues={{
          size: componentSize,
        }}
        onValuesChange={onFormLayoutChange}
        size={componentSize}
      >
        <Form.Item label="Mã hóa đơn">
          <Input disabled/>
        </Form.Item>
        <Form.Item label="Ngày lập hóa đơn">
        <Input disabled/>
        </Form.Item>
        <Form.Item label="Tổng tiền">
        <Input disabled/>
        </Form.Item>
      </Form>
      <Form
        labelCol={{
          span: 4,
        }}
        wrapperCol={{
          span: 14,
        }}
        layout="horizontal"
        initialValues={{
          size: componentSize,
        }}
        onValuesChange={onFormLayoutChange}
        size={componentSize}
      >
        <Form.Item label="Mã hóa đơn">
          <Input disabled/>
        </Form.Item>
        <Form.Item label="Ngày lập hóa đơn">
        <Input disabled/>
        </Form.Item>
        <Form.Item label="Tổng tiền">
        <Input disabled/>
        </Form.Item>
      </Form>
    </>
  );
};
export default chiTietDH;
